	function postMessage() {
		if (window.parent != window) {
			var json = JSON.stringify({});
			window.parent.postMessage(json, window.parent.origin);
		}
	}

	function prev(id) {
		var previds = [];
		for (var previd in tree) {
			if (tree[previd].next.indexOf(id) >= 0) {
				previds.push(previd);
			}
		}
		return previds;
	}

	var anchored = (function() {
		var visited;
		return function(id, substep) {
			if (!substep) {
				visited = [];
			}
			visited.push(id);

			var previds = prev(id);
			for (var previd of previds) {
				if (visited.indexOf(previd) < 0 && tree[previd].checked) {
					return anchored(previd, true);
				}
			}
			return !previds.length;
		};
	})();

	var uncheck = (function() {
		var visited;
		return function(id, substep) {
			if (!substep) {
				visited = [];
			}
			visited.push(id);

			var node = document.getElementById(id);
			node.classList.remove("checked");
			for (var e of document.getElementsByClassName(id)) {
				e.classList.remove("checked");
			}
			tree[id].checked = false;

			for (var nextid of tree[id].next) {
				if (visited.indexOf(nextid) < 0 && tree[nextid].checked) {
					if (!anchored(nextid)) {
						uncheck(nextid, true);
					}
				}
			}
		};
	})();

	var check = (function() {
		var visited;
		return function(id, substep) {
			if (!substep) {
				visited = [];
			}
			visited.push(id);

			var previds = prev(id);
			for (var previd of previds) {
				if (tree[previd].checked) {
					previds = [];
				}
			}
			for (var previd of previds) {
				if (visited.indexOf(previd) < 0) { 
					check(previd, true);
					break;
				}
			}

			var node = document.getElementById(id);
			node.classList.add("checked");
			for (var e of document.getElementsByClassName(id)) {
				e.classList.add("checked");
			}
			tree[id].checked = true;
		};
	})();

	function updateLines() {
		for (var line of document.getElementsByTagName("line")) {
			var ids = line.dataset.ids.split(" ");
			if (ids.every(function (id) {
				return tree[id].checked;
			})) {
				line.classList.add("checked");
			}
			else {
				line.classList.remove("checked");
			}
		}
	}

	function updatePaths(e) {
		if (e.target.id in tree) {
			var id = e.target.id;
			if (tree[id].checked) {
				uncheck(id);
			}
			else {
				check(id);
			}
			updateLines();
			postMessage();
		}
	}

	window.addEventListener("click", updatePaths);
